    public void init3() // 다익스트라(Dijkstra) 알고리즘/단일 점에 따라 최단거리
    {
        std = new ArrayList<int[]>();
        charge1(std);
        charge2(std);
        n = std.size();

        dis = new int[n];
        visit = new boolean[n];
        prev = new int[n];
        stack = new int[n];
        stackV=new Vector<Integer>();
        st = new ArrayList<>();
//        dj = new Dijkstra();
    }
    public int dijkstra3(int start,int end)
    {
        System.out.println("==========================================================");
        System.out.println("Dijkstra start");
        System.out.println("startPoint: "+start);
        System.out.println("endPoint: "+end);
        System.out.println("===========================================================");
        s=start;
        e=end;

        init3();

        int k=0;
        int min=0;



        for (int i = 0; i < n; i++) { /* 초기화 */
            dis[i] = INF;
            prev[i] = 0;
            visit[i] = false;
        }

        dis[s] = 0; /* 시작점의 거리는 0 */

        for (int i = 0; i < n; i++) {
            min = INF;
            for (int j = 0; j < n; j++) { /* 정점의 수만큼 반복 */
                if (visit[j] == false && dis[j] < min) { /* 확인하지 않고 거리가 짧은 정점을 찾음 */
                    k = j;
                    min = dis[j];
                }
            }
            visit[k] = true; /* 해당 정점 확인 체크 */

            if (min == INF)break; /* 연결된 곳이 없으면 종료 */

            /****
             * I -> J 보다 I -> K -> J의
             * 거리가 더 작으면
             * 갱신
             ****/
            for (int j = 0; j < n; j++) {
                if (dis[k] + std.get(k)[j] < dis[j]) {
                    dis[j] = dis[k] + std.get(k)[j]; /* 최단거리 저장*/
                    prev[j] = k; /* J로 가기 위해서는 K를 거쳐야 함 */
                }
            }
        }
        nowLeastDistance();   //콘솔에서 최단거리 출력
//        inverseFind();			// 콘솔에서 최단 경로 출력
        return dis[e];
    }

